import React from 'react'
var tf = require('@tensorflow/tfjs')

let model = null
let uri = window.location.href + '/src/components/modelJS/model.json'
console.log(window.location.href)
model = tf.loadLayersModel(uri)

const Main = () => {

	if (model == null) 
		console.log('model loaded')
	return null
}

export default Main;
